import React from 'react'
import './TextElement.css'

export const TextElement = (props) => {
  const textBlock =
    props.textElementype == 'h1' ? (
      <h1>{props.text}</h1>
    ) : props.textElementype == 'h2' ? (
      <h2>{props.text}</h2>
    ) : props.textElementype == 'h3' ? (
      <h3>{props.text}</h3>
    ) : props.textElementype == 'h4' ? (
      <h4>{props.text}</h4>
    ) : props.textElementype == 'h5' ? (
      <h5>{props.text}</h5>
    ) : props.textElementype == 'h6' ? (
      <h6>{props.text}</h6>
    ) : props.textElementype == 'p' ? (
      <p>{props.text}</p>
    ) : props.textElementype == 'c' ? (
      <p className="caption">{props.text}</p>
    ) : props.textElementype == 'e' ? (
      <p className="eyebrow">{props.text}</p>
    ) : null

  return <div className="text-block">{textBlock}</div>
}
